import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Button from '@mui/material/Button';
import useMediaQuery from '@mui/material/useMediaQuery';
import PersonAddAltIcon from '@mui/icons-material/PersonAddAlt';
import LogoutIcon from '@mui/icons-material/Logout';
import DeleteSweepIcon from '@mui/icons-material/DeleteSweep';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import IconButton from '@mui/material/IconButton/IconButton';
import ListIcon from '@mui/icons-material/List';
import ApiAccess from '../services/api-access';
import { useHistory } from 'react-router-dom';
import MyModal from './MyModal';
import routes from '../helpers/routes';
import Modal from 'react-modal';

Modal.setAppElement('#root');

const pages = ['Enregistrement Ã©tudiant', 'Vider la base'];
const settings = ['Liste de comptes', 'Profil', 'Deconnexion'];

function AdminNavBar() {

    // Check if the screen size is medium or smaller
    const isMediumScreen = useMediaQuery('(max-width: 800px)');
    const [isLogoutDialogOpen, setLogoutDialog] = React.useState(false);
    const [isClearDialogOpen, setClearDialog] = React.useState(false);

    const LogoutManagement = () => {
        ApiAccess.logout();
    }

    const ClearBase = () => {
        ApiAccess.clearBase();
    }

    const history = useHistory();

    const goToPage = (path: any) => {
        history.push(path);
    };

    const openLogoutDialog = () => {
        setLogoutDialog(true);
    }

    const closeLogoutDialog = () => {
        setLogoutDialog(false);
    }

    const openClearDialog = () => {
        setClearDialog(true);
    }

    const closeClearDialog = () => {
        setClearDialog(false);
    }

    return (
        <React.Fragment>
            <AppBar position="static">
                <Container maxWidth="xl">
                    <Toolbar sx={{ justifyContent: 'space-between' }} disableGutters>
                        <Box>
                            {isMediumScreen ? (
                                <React.Fragment>
                                    <IconButton
                                        size="large"
                                        aria-label="add student button"
                                        aria-haspopup="true"
                                        color="inherit"
                                        onClick={() => goToPage(routes.addstudent)}
                                    >
                                        <PersonAddAltIcon />
                                    </IconButton>
                                    <IconButton
                                        size="large"
                                        aria-label="clear base"
                                        aria-haspopup="true"
                                        color="inherit"
                                        onClick={openClearDialog}
                                    >
                                        <DeleteSweepIcon />
                                    </IconButton>
                                </React.Fragment>
                            ) : (
                                pages.map((page) => (
                                    <Button key={page} sx={{ color: 'inherit', mr: 2 }}>
                                        {page}
                                    </Button>
                                ))
                            )}
                        </Box>

                        <Typography
                            variant="h6"
                            noWrap
                            component="a"
                            href="#app-bar-with-responsive-menu"
                            sx={{
                                fontFamily: 'monospace',
                                fontWeight: 700,
                                color: 'inherit',
                                textDecoration: 'none',
                            }}
                        >
                            Students APP
                        </Typography>
                        <Box>
                            {isMediumScreen ? (
                                <React.Fragment>
                                    <IconButton
                                        size="large"
                                        aria-label="deconnection"
                                        aria-haspopup="true"
                                        color="inherit"
                                        onClick={openLogoutDialog}
                                    >
                                        <LogoutIcon />
                                    </IconButton>
                                    <IconButton
                                        size="large"
                                        aria-label="account update"
                                        aria-haspopup="true"
                                        color="inherit"
                                        onClick={() => goToPage("/profil")}
                                    >
                                        <AccountCircleIcon />
                                    </IconButton>
                                    <IconButton
                                        size="large"
                                        aria-label="accounts list"
                                        aria-haspopup="true"
                                        color="inherit"
                                        onClick={() => goToPage("/account/list")}
                                    >
                                        <ListIcon />
                                    </IconButton>
                                </React.Fragment>
                            ) : (
                                settings.map((setting) => (
                                    <Button key={setting} sx={{ color: 'inherit' }} >
                                        {setting}
                                    </Button>
                                ))
                            )}
                        </Box>
                    </Toolbar>
                </Container>
            </AppBar>

            <MyModal isOpen={isLogoutDialogOpen} onClose={closeLogoutDialog} onConfirm={LogoutManagement}>
                Vous allez vous dÃ©connectÃ©
                Ãtes vous sÃ»r de continuer ?
            </MyModal>

            <MyModal isOpen={isClearDialogOpen} onClose={closeClearDialog} onConfirm={ClearBase}>
                Cette action vide la base 
                Cette action est irreversible
                Ãtes vous sÃ»r de vouloir continuer ?
            </MyModal>
        </React.Fragment>
    );
}
export default AdminNavBar;
